import React, {Component} from 'react';
import '../styles/App.css';
import StudentPage from "../component/StudentPage";
import { BrowserRouter as Router } from "react-router-dom";
import Switch from "react-router-dom/es/Switch";
import Route from "react-router-dom/es/Route";
import MainPage from "../component/MainPage";
import CompanyPage from "../component/CompanyPage";
import LoginPage from "./LoginPage";
import RegistrationPage from "./RegistrationPage";
import ProjectDetailComponent from "./ProjectDetailComponent";

class App extends Component{

    render() {
        return (
            <div className="APP">

                <Router>
                    <>
                        <Switch>
                            <Route path="/" exact component={MainPage} />
                            <Route path="/login"  component={LoginPage} />
                            <Route path="/student" component={StudentPage} />
                            <Route path="/company" component={CompanyPage} />
                            <Route path="/registration" component={RegistrationPage} />
                            <Route path="/projects/:id" component={ProjectDetailComponent} />
                        </Switch>
                    </>
                </Router>
            </div>
        );
    }


}

export default App;
